import React from "react";
import { BrowserRouter as Router, Routes, Route } from "react-router-dom";
import NavBar from "./components/NavBar";
import Footer from "./components/Footer";

import About from "./components/About";
import Specials from "./components/Specials";
import Order from "./components/Order";
import Login from "./components/Login";
import ReservationStepOne from './components/ReservationStepOne';
import ReservationStepTwo from './components/ReservationStepTwo';
import ReservationSuccess from './components/ReservationSuccess';

function App() {
  return (
    <Router>
      {/* <NavBar /> */}
      <Routes>
        <Route path="/" element={<Home />} />
        <Route path="/components/about" element={<About />} />
        <Route path="/components/specials" element={<Specials />} />
        <Route path="/components/order" element={<Order />} />
        <Route path="/components/login" element={<Login />} />
        <Route path="/components/reservationstepone" element={<ReservationStepOne />} />
        <Route path="/components/reservationsteptwo" element={<ReservationStepTwo />} />
        <Route path="/components/reservationsuccess" element={<ReservationSuccess />} />
      </Routes>
      {/* <Footer /> */}
    </Router>
  );
}

export default App;
